            number pan_tilde_02_func_next(number pos, int channel) {
                {
                    {
                        number nchan_1 = 2 - 1;
            
                        {
                            pos = pos * nchan_1;
                        }
            
                        {
                            {
                                {
                                    if (pos <= -1 || pos >= 2)
                                        return 0;
                                }
                            }
                        }
            
                        pos = pos - channel;
            
                        if (pos > -1 && pos < 1) {
                            {
                                {
                                    return this->safesqrt(1.0 - rnbo_abs(pos));
                                }
                            }
                        } else {
                            return 0;
                        }
                    }
                }
            }
            
